import React, { useState } from 'react';
import axiosInstance from '../../api/axiosInstance';

const PemeriksaanManualInput = () => {
  const [formData, setFormData] = useState({
    jam: '',
    nama_petugas: '',
    pax: '',
    flight: '',
    orang: '',
    barang: '',
    temuan: '',
    keterangan: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      const response = await axiosInstance.post('/pemeriksaan-manual', formData);
      setSuccess('Form submitted successfully!');
      setFormData({ jam: '', nama_petugas: '', pax: '', flight: '', orang: '', barang: '', temuan: '', keterangan: '' });
    } catch (err) {
      setError(err.response?.data?.message || 'An error occurred');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-md mx-auto p-4 bg-white rounded shadow space-y-4">
      <div>
        <label className="block font-medium mb-1">Jam</label>
        <input type="time" name="jam" value={formData.jam} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Nama Petugas</label>
        <input type="text" name="nama_petugas" value={formData.nama_petugas} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Pax</label>
        <input type="text" name="pax" value={formData.pax} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Flight</label>
        <input type="text" name="flight" value={formData.flight} onChange={handleChange} required className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Orang</label>
        <input type="number" name="orang" value={formData.orang} onChange={handleChange} required className="border px-3 py-2 rounded w-full" min="0" />
      </div>
      <div>
        <label className="block font-medium mb-1">Barang</label>
        <input type="number" name="barang" value={formData.barang} onChange={handleChange} required className="border px-3 py-2 rounded w-full" min="0" />
      </div>
      <div>
        <label className="block font-medium mb-1">Temuan</label>
        <textarea name="temuan" value={formData.temuan} onChange={handleChange} className="border px-3 py-2 rounded w-full" />
      </div>
      <div>
        <label className="block font-medium mb-1">Keterangan</label>
        <textarea name="keterangan" value={formData.keterangan} onChange={handleChange} className="border px-3 py-2 rounded w-full" />
      </div>
      <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">Submit</button>
      {error && <p className="text-red-500 text-sm">{error}</p>}
      {success && <p className="text-green-600 text-sm">{success}</p>}
    </form>
  );
};

export default PemeriksaanManualInput;
